import './App.css';
import { Routes, Route} from 'react-router-dom';
import BookList from './components/BookList';
import BookDetails from './components/BookDetail';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Favorites from './components/Favorites';
import Katalog from './components/Katalog';
import { Link } from 'react-router-dom';
import SearchBox from './components/SearchBox';
import LoginForm from './components/zaloguj';
import RegisterForm from './components/zarejestruj';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Routes>

        <Route path="/books/:id" element={<BookDetails/>} />
        <Route path="/favorites" element={<Favorites/>} />
        <Route path="/katalog" element={<Katalog/>} />
        <Route path="/zaloguj" element={<LoginForm/>} />
        <Route path="/zarejestruj" element={<RegisterForm/>} />
        <Route path="/readBooks" element={<ReadBooks/>} />
        <Route path="/toReadBooks" element={<ToReadBooks/>} />
      </Routes>
      <Footer/>


    </div>
  );
}



export default App;
